const x =[
    "",
    "",
    "",
    "",
    ""
];

const keyPad = [
    [1, 2, 3],
    [4, 5, 6],
    [7, 8, 9]
];

let pos = {
    x: 1,
    y: 1
};

let code = [];

for(let i = 0; i<x.length; i++){
    let str = x[i];

    code.push(getButton(str));
}
console.log(code);
function getButton(str){
    for(let i = 0; i<str.length; i++){
        switch (str[i]) {
            case "U":
                if(pos.y > 0) pos.y--;
                break;
            case "R":
                if(pos.x < 2) pos.x++;
                break;
            case "D":
                if(pos.y < 2) pos.y++;
                break;
            case "L":
                if(pos.x > 0) pos.x--;
                break;
            default:

        }
    }

    return keyPad[pos.y][pos.x];
}
